  false,\n\t\"url\": null,\n\t\"notes\": \"The Geospatial Multi-Agency Coordination
  Group, or GeoMAC, is an internet-based mapping tool originally designed for fire
  managers to access online maps of current fire locations and perimeters in the conterminous
  48 states and Alaska. Perimeters are submitted to GeoMAC by field offices and then
  posted to an FTP site for downloading. This file contains fire perimeters submitted
  from the year 2000 to 2010. The projection is geographic and the datum is NAD83.
  Last updated in April, 2011.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
